import GlobalStyle from "../styles/GlobalStyle";
import Navigation from "../components/Navigation";

import "../styles/reset.css";

function MyApp({ Component, pageProps }) {
  return (
    <>
      <GlobalStyle />
      <Layout>
        <Navigation />
        <Component {...pageProps} />
      </Layout>
    </>
